import React from 'react';


const Menu = () => {

    return(
        <div className="ContainerSatu">

            <div className="LogoContainer">
            <div className="Logo">LOGO</div>
            </div>

            <div className="MenuContainer">

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>

                <div className="MenutBtn">
                    <div className="LogoMenu">test</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>
            </div>

            <div className="footer">
                <div className="Profile"></div>
                <div className="Nama">Budi</div>
            </div>

        </div>


    );


};


const Isi = () => {

    return(

    <div className="ContainerDua">

        <div className="Header"></div>

        <div className="Header2Container">
            <div className="buttonKiri"></div>
            <div className="buttonKanan"></div>
        </div>


        <div className="CardContainer">
            <Card />

        </div>


    </div>


    );




};


const Card = () => {
    return(
        <div className="CardContainer">

            <div className="Delete">delete</div>

            <div className="FotodanNama">
                <div className="Foto">foto</div>

                <div className="Nama">
                    <div className="Atas">kurt cobain</div>
                    <div className="Bawah">kontrol behel</div>
                </div>
            </div>

            <div className="CheckOrCancelContainer">
                <div className="JamJadwal">11:00</div>

                <div className="CnC">
                    <div className="btnCheck">Check</div>
                    <div className="btnCancel">Cancel</div>
                </div>


            </div>


        </div>


    );



};



const HomeContainer = () => {

    return(
       <div className="test">
        <Menu />
        <Isi />
        </div>


    );



};

export default HomeContainer;
